			<Logo>
				<img className="logo-image" src="/images/logo.png" />
			</Logo>
			<ButLoading />
			<Texto>
				Estamos <Span primary>buscando ...</Span>
				<br />
				espera un <Span>poco</Span> más <Span primary>Ü</Span>
			</Texto>
		</Container>
		// </div>
	);
};

export default Loading;
